import axios from "axios";
import store from "../../index";

const addTeamToAllianceApi = async (team, alliance) => {
  const teams_url = `http://cms.avertra.com/teams${team.id}`;
     const headers = { Authorization: "Bearer " + store.getState().token };
     var data = JSON.stringify({
       alliance: "615963a462b183a56be98afc",
     });
  try {
    const resp = await axios.get(teams_url, {
      headers: headers,
    });
    console.log();
    return resp.data;
  } catch (err) {
    console.error(err);
    return [];
  }
};
export { addTeamToAllianceApi };
